import logo from './logo.svg';
import './App.css';

function App() {
  const buildHeaders = () => {
    let token = localStorage.getItem("token")
    if (!token) {
      window.location = '/login'
    }else{
      console.log(token);
    }
  }
  buildHeaders();
  return (
    <div className="App">
      <div style={{ marginBottom: '50px' }}>
        <button onClick={
          window.location = '/login'
        }>log out</button>
      </div>
      <p id='response'></p>
    </div>
  );
}
